import React from "react";
import axios from "axios";

export default class Home extends React.Component{
    constructor(){
        super();
        this.state={
            movies:[],
            footer:false,
        }
    }

    componentDidMount () {
        axios
            .post(`https://hoblist.com/movieList`)
            .then((response) => {
                console.log(response)
                this.setState({
                    movies:response.data
                })
              })
              .catch((err) => {
                if (err.response)
                  console.log("Error")
                else console.log(err);
              });
    }

    handlefooter = () => {
        this.setState ({
            footer:true,
        })
    }

    render(){
        return(
            <div>
                <nav class="navbar navbar-expand-lg"  style={{background:"#e3f2fd", cursor:"pointer"}}>
                    <a class="navbar-brand" href="#" >Geeksynergy Technologies</a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>

                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav mr-auto">
                        </ul>
                    </div>
                    <form class="form-inline my-2 my-lg-0">
                            <a class="nav-link" onClick={this.handlefooter} >Company Info <span class="sr-only">(current)</span></a>
                    </form>
                </nav>
              <div>
                 {/* {this.state.movies.map((item, i) => {
                     return(
                             <ul>
                                 <li>{item.category}</li>
                                 <li>{item.language}</li>
                                 <li>{item.genre}</li>
                                 <li>{item.sort}</li>
                             </ul>
                             )
                         })} */}
                
                         </div>
                  {this.state.footer && <div className="footer" 
                  style={{position:"fixed", textAlign:"center", width:"100%", marginTop:15, 
                  bottom:0, fontSize:12, color:"#0056b3", background:"#e3f2fd" }}>            
                        <h5>Company: Geeksynergy Technologies Pvt Ltd</h5>
                        <p>Address: Sanjayanagar, Bengaluru-56</p>
                        <p>Phone:XXXXXXXXX09</p>
                        <p>Email: XXXXXX@gmail.com</p>
                        <p>24, 3rd Main Rd, Kempaiah Layout, Shivakrupa CKM Road, Sanjaynagar, Bengaluru-560094</p>
                  </div>}
            </div>

        )
    }
}
